use schema jpnsdl_raw;
  
CREATE OR REPLACE FILE FORMAT FILE_FORMAT_EDI_SOH
	FIELD_DELIMITER = '\u0001'
	SKIP_HEADER = 1
	DATE_FORMAT = 'auto'
	TIME_FORMAT = 'YYYY-MM-DD HH24:MI:SS'
	ERROR_ON_COLUMN_COUNT_MISMATCH = FALSE
	EMPTY_FIELD_AS_NULL = FALSE
	ENCODING = 'UTF-8'
;
CREATE OR REPLACE FILE FORMAT FILE_FORMAT_POS_COMMA
	SKIP_HEADER = 1
	DATE_FORMAT = 'auto'
	TIME_FORMAT = 'YYYY-MM-DD HH24:MI:SS'
	ERROR_ON_COLUMN_COUNT_MISMATCH = FALSE
	EMPTY_FIELD_AS_NULL = FALSE
	ENCODING = 'Shift-JIS'
;
CREATE OR REPLACE FILE FORMAT FILE_FORMAT_SOH
	TYPE = csv
	FIELD_DELIMITER = '\u0001'
	SKIP_HEADER = 1
	NULL_IF = ('')
	ERROR_ON_COLUMN_COUNT_MISMATCH = FALSE
	EMPTY_FIELD_AS_NULL = FALSE
	ENCODING = 'UTF-8'
;

